@jit
def calc_gg_coupling(g_, field_value_, g, field_value):

    def _wrapper(g_, field_value_, field_value, g):
        g_eff = 0.5 * (g_ + g)
        j_pair = g_eff * (field_value * field_value_ - field_value_ * field_value)
        return j_pair
    gg_coupling = vmap(_wrapper, in_axes=(0, 0, 0, None, None))(g_, field_value_, field_value, g)
    return gg_coupling

@jit
def calc_dV_dh(vev: jnp.ndarray, lambda_H: jnp.ndarray, h: jnp.ndarray) -> jnp.ndarray:
    mu = vev * jnp.sqrt(lambda_H)
    dV_dh = -mu ** 2 * (vev + h) + lambda_H * (vev + h) ** 3
    return dV_dh

@jit
def calc_dmu_h(h, prev, d, dt, pm_axes: tuple[list[tuple], list[tuple]]):

    @jit
    def _d_spatial(field_forward, field_backward, d_space):
        return (field_forward - field_backward) / (2.0 * d_space)

    def _d_time(field_current, field_prev, d_time):
        return (field_current - field_prev) / d_time

    def _calc_spatial_derivative(dir_p, dir_m):
        np = jnp.roll(h, shift=dir_p, axis=(0, 1, 2, 3))
        nm = jnp.roll(h, shift=dir_m, axis=(0, 1, 2, 3))
        calc_result = _d_spatial(field_forward=np, field_backward=nm, d_space=d)
        return calc_result
    vmapped_func = vmap(_calc_spatial_derivative, in_axes=(0, 0))
    dmu_spatial = vmapped_func(*pm_axes)
    time_res = _d_time(field_current=h, field_prev=prev, d_time=dt)
    dmu_h = list(dmu_spatial)
    dmu_h.insert(0, time_res)
    return dmu_h

@jit
def calc_energy_density(dmu_h: jnp.ndarray, mass: jnp.ndarray, h: jnp.ndarray, vev: jnp.ndarray, laplacian_h: jnp.ndarray) -> jnp.ndarray:

    def _higgs_potential(mass: jnp.ndarray, h: jnp.ndarray, vev: jnp.ndarray, laplacian_h: jnp.ndarray) -> jnp.ndarray:
        m2 = mass ** 2
        return 0.5 * m2 * h ** 2 + laplacian_h * vev * h ** 3 + 0.25 * laplacian_h * h ** 4
    kinetic = 0.5 * dmu_h[0] ** 2
    gradient = 0.5 * jnp.sum(dmu_h[1:] ** 2)
    potential = _higgs_potential(mass, h, vev, laplacian_h)
    energy_density = kinetic + gradient + potential
    return energy_density

@jit
def calc_h(h: jnp.ndarray, mass: jnp.ndarray, prev: jnp.ndarray, laplacian_h: jnp.ndarray, dV_dh: jnp.ndarray, dt: jnp.ndarray) -> jnp.ndarray:

    def _mass_term(h: jnp.ndarray, mass: jnp.ndarray) -> jnp.ndarray:
        return -mass ** 2 * h
    mass_term = _mass_term(h, mass)
    dt2 = jnp.asarray(dt) ** 2
    h = 2.0 * h - prev + dt2 * (laplacian_h + mass_term - dV_dh)
    return h

@jit
def calc_lambda_H(mass: jnp.ndarray, vev: jnp.ndarray) -> jnp.ndarray:
    lambda_H = mass ** 2 / (2.0 * vev ** 2)
    return lambda_H

@jit
def calc_laplacian_h(h: jnp.ndarray, pm_axes, d, dt) -> jnp.ndarray:

    @jit
    def _d_spatial(field_forward, field_backward, d_space):
        return (field_forward - field_backward) / (2.0 * d)

    def _wrapper(dir_p, dir_m, h, d):
        np = jnp.roll(h, shift=dir_p, axis=(0, 1, 2, 3))
        nm = jnp.roll(h, shift=dir_m, axis=(0, 1, 2, 3))
        calc_result = _d_spatial(field_forward=np, field_backward=nm, d_space=d)
        return calc_result
    result = vmap(_wrapper, in_axes=(0, 0, None, None, None))(*pm_axes, h, d, dt)
    laplacian_h = jnp.sum(result)
    return laplacian_h

@jit
def calc_phi(h: jnp.ndarray, vev: jnp.ndarray) -> jnp.ndarray:
    sqrt2 = jnp.sqrt(2.0)
    phi = jnp.stack([0.0, (vev + h) / sqrt2])
    return phi

@jit
def calc_psi(psi, dt, dirac):
    psi = psi + dt * dirac
    return psi

@jit
def calc_psi_bar(psi, gamma):
    psi_bar = psi.conj().T @ gamma[0]
    return psi_bar
